import React, {Fragment} from 'react';

const Nav = (props) => {
    const tabs = ['Home', 'Projects', 'Resume']





    return (
        <Fragment>
            <ul>
                {tabs.map(tab => {
                    <li key = {tab}>
                        <a href={'#' + tab.toLocaleLowerCase()}
                        onClick={() => props.handlePageChange(tab)}
                           className={
                            props.currentPage === tab ? 'nav-link active' : 'nav-link'
                           }
                        >
                            {tab}

                        </a>
                    </li>
                })}
            </ul>
        </Fragment>
    )
}
export default Nav;
